import { createSlice } from '@reduxjs/toolkit';

// const initialState = {
//   socket:"",
// };

const initialState = [];

export const socketSlice = createSlice({
  name:"socket",
  initialState,
  reducers:{
    getDataSocket:(action) =>{
       return action.payload
    }
  }
})

export const { getDataSocket } = socketSlice.actions
export default socketSlice.reducer;
